var currentTime = document.querySelector("#currentTime");
currentTime.addEventListener('touchstart', function (startObj) {
    "use strict";

    var moveStart = void 0;
    moveStart = startObj.touches[0].clientX;
    currentTime.addEventListener('touchend', function (endObj) {
        var move = endObj.changedTouches[0].clientX - moveStart;
        console.log(move);
    });
}, false);